import React from 'react';

const Observation = props => {
    state = {joke : {}, jokes:[] };
    const vals = props.observation;

    return(
        <div style={{display:'inline-block', width: 300, margin:10}} >
          {vals.mo},{vals.yr},{vals.type}
        </div>
    )

}

export default Observation
